import React, { useState, useEffect } from 'react';
import api from '../utils/api';
import './AdvancedAnalysis.css';

function AdvancedAnalysis({ useCases }) {
  const [analysisData, setAnalysisData] = useState([]);
  const [selectedUseCase, setSelectedUseCase] = useState('');
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchAnalysisData();
  }, [selectedUseCase]);

  const fetchAnalysisData = async () => {
    setLoading(true);
    setError(null);
    try {
      const params = selectedUseCase ? { use_case: selectedUseCase } : {};
      const response = await api.get('/api/kpi/analysis', { params });
      setAnalysisData(response.data.analysis);
    } catch (err) {
      setError(err.response?.data?.error || 'Failed to fetch analysis data');
    } finally {
      setLoading(false);
    }
  };

const formatValue = (value, kpi) => {
  if (value === null || value === undefined || isNaN(value)) {
    return '-';
  }
  
  if (kpi === 'REVENUE') {
    return new Intl.NumberFormat('en-US', { 
      style: 'currency', 
      currency: 'USD',
      maximumFractionDigits: 0
    }).format(value);
  }
  if (kpi === 'AOV') {
    return new Intl.NumberFormat('en-US', { 
      style: 'currency', 
      currency: 'USD',
      minimumFractionDigits: 2,
      maximumFractionDigits: 2
    }).format(value);
  }
  if (kpi === 'RPV') {
    return new Intl.NumberFormat('en-US', { 
      style: 'currency', 
      currency: 'USD',
      minimumFractionDigits: 2,
      maximumFractionDigits: 4
    }).format(value);
  }
  if (kpi === 'CVR') {
    return `${value.toFixed(4)}%`;
  }
  if (kpi === 'VISITS' || kpi === 'ORDERS') {
    return new Intl.NumberFormat('en-US', {
      maximumFractionDigits: 0
    }).format(value);
  }
  return new Intl.NumberFormat('en-US', {
    minimumFractionDigits: 2,
    maximumFractionDigits: 4
  }).format(value);
};

  const formatLift = (value) => {
    const formatted = value.toFixed(2);
    const isPositive = value > 0;
    const isNegative = value < 0;
    
    return (
      <span className={`lift-value ${isPositive ? 'positive' : ''} ${isNegative ? 'negative' : ''}`}>
        {isPositive ? '+' : ''}{formatted}%
      </span>
    );
  };

  if (loading) {
    return (
      <div className="analysis-loading">
        <div className="loading-spinner"></div>
        <p>Loading analysis data...</p>
      </div>
    );
  }

  if (error) {
    return (
      <div className="analysis-error glass-card-solid">
        <h3>Error Loading Data</h3>
        <p>{error}</p>
      </div>
    );
  }

  return (
    <div className="advanced-analysis">
      <div className="analysis-header">
        <div className="header-left">
          <h1>Advanced Analysis</h1>
          <p className="header-description">Pre/Post launch performance comparison</p>
        </div>
        <div className="header-controls">
          <select
            value={selectedUseCase}
            onChange={(e) => setSelectedUseCase(e.target.value)}
            className="select-control"
          >
            <option value="">All Use Cases</option>
            {useCases.map(uc => (
              <option key={uc} value={uc}>{uc}</option>
            ))}
          </select>
        </div>
      </div>

      {analysisData.length > 0 && (
        <div className="analysis-info glass-card">
          <div className="info-item">
            <span className="info-label">Launch Date</span>
            <span className="info-value">{analysisData[0].launch_date}</span>
          </div>
          <div className="info-item">
            <span className="info-label">Days Since Launch</span>
            <span className="info-value">{analysisData[0].post_days}</span>
          </div>
        </div>
      )}

      <div className="analysis-table-container glass-card-solid">
        <table className="analysis-table">
          <thead>
            <tr>
              <th>Use Case</th>
              <th>KPI</th>
              <th>Pre LY</th>
              <th>Pre TY</th>
              <th>Pre Lift</th>
              <th>Post LY</th>
              <th>Post TY</th>
              <th>Post Lift</th>
              <th>Pre-Post Comp Lift</th>
            </tr>
          </thead>
          <tbody>
            {analysisData.map((row, index) => (
              <tr key={`${row.use_case}-${row.kpi}-${index}`}>
                <td className="use-case-cell">{row.use_case}</td>
                <td className="kpi-cell">{row.kpi}</td>
                <td>{formatValue(row.pre_ly, row.kpi)}</td>
                <td>{formatValue(row.pre_ty, row.kpi)}</td>
                <td>{formatLift(row.pre_lift)}</td>
                <td>{formatValue(row.post_ly, row.kpi)}</td>
                <td>{formatValue(row.post_ty, row.kpi)}</td>
                <td>{formatLift(row.post_lift)}</td>
                <td className="comp-lift-cell">{formatLift(row.pre_post_comp_lift)}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <div className="analysis-legend">
        <div className="legend-item">
          <span className="legend-dot pre"></span>
          <span>Pre: Time period before launch date (same duration as post period)</span>
        </div>
        <div className="legend-item">
          <span className="legend-dot post"></span>
          <span>Post: Time period from launch date to today</span>
        </div>
        <div className="legend-item">
          <span className="legend-dot ly"></span>
          <span>LY: Last Year (same date range, previous year)</span>
        </div>
        <div className="legend-item">
          <span className="legend-dot ty"></span>
          <span>TY: This Year (current year)</span>
        </div>
        <div className="legend-item">
          <span className="legend-dot lift"></span>
          <span>Lift: Percentage change ((TY - LY) / LY x 100)</span>
        </div>
        <div className="legend-item">
          <span className="legend-dot comp"></span>
          <span>Pre-Post Comp Lift: Post Lift - Pre Lift (incremental impact)</span>
        </div>
      </div>
    </div>
  );
}

export default AdvancedAnalysis;
